// Input: <p>c1 : X</p><c1 : Y</p><p>c2 : R</p>
// Output: <p>c1 : X</p><p>c2 : R</p>
function clean_cell_2s(cell_2s) {
	var ret = "";
	var past = new Array();
	if(cell_2s != "") {
		var arr = cell_2s.split("</p>");
		var value, cur;
		for(var i=0; i<arr.length; i++) {
			value = arr[i].substring(3, arr[i].indexOf(" :"));
			if(past.indexOf(value)==-1) {
				past.push(value);
				ret = ret+arr[i]+"</p>";
			}
		}
	}
	return ret;
}